func.push({
    name: "画图plus",
    question: async () => {
        lsdh(false)
        add_conversation("user", app.question)
        // let matched_tags = sd_tags.filter(i => app.question.includes(i[1]))
        matched_tags = (await find_rtst_memory(app.question, "sd",true)).map(i => [i.title, i.content,i.score]).filter(i=>i[2]<170)
        let matched_tags_str = matched_tags.map(i => i[0]).join(',')
        add_conversation("AI", "正在绘图：" + matched_tags_str, matched_tags.map(e =>
            ({ title: e[1], content: e[0]+`(${e[2]})` })
        ), no_history = true)
        app.loading = true
        response = await fetch("/api/sd_agent", {
            // signal: signal,
            method: 'post',
            body: JSON.stringify({
                prompt: `((masterpiece, best quality)), photorealistic,` + matched_tags_str,
                steps: 20,
                sampler_name: "DPM++ SDE Karras",
                negative_prompt: `paintings, sketches, (worst quality:2), (low quality:2), (normal quality:2), lowres, normal quality, ((monochrome)), ((grayscale)), skin spots, acnes, skin blemishes, age spot, glans`
            }),
            headers: {
                'Content-Type': 'application/json'
            }
        })
        try {
            let json = await response.json()
            app.chat[app.chat.length - 1].content = matched_tags_str + '\n![](data:image/png;base64,' + json.images[0] + ")"
        } catch (error) {
            alert("连接SD API失败，请确认已开启agents库，并将SD API地址设置为127.0.0.1:786")
        }
        app.loading = false
        save_history()
    },
})
